import React from 'react';
import { Link } from 'react-router-dom';
import { AvatarImage, AvatarFallback, Avatar } from "@/components/ui/avatar";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { CardTitle, CardHeader, CardContent, Card } from "@/components/ui/card";
import { ResponsiveLine } from "@nivo/line";
import { ResponsiveBar } from "@nivo/bar";
import { Label } from "@/components/ui/label";

const Sidebar = () => {
    return (
      <div style={{ width: '200px', backgroundColor: '#f0f0f0', padding: '20px' }}> 
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          <li style={{ marginBottom: '20px' }}>
            <Link to="/mypage" style={{ textDecoration: 'none', color: '#333', fontWeight: 'bold' }}>회원 정보</Link>
          </li>
          <li>
            <Link to="/Stats" style={{ textDecoration: 'none', color: '#333', fontWeight: 'bold' }}>내 채널 통계</Link>
          </li>
        </ul>
      </div>
    );
  };

const Stats = () => {
  return (
    <div style={{ display: 'flex', flexDirection: 'row', flexGrow: 1 }}>
      <Sidebar />
      <Component />
    </div>
  );
};

export default Stats;

function Component() {
  return (
    <div className="flex flex-col h-screen flex-grow">
      <header className="bg-gray-900 text-white py-4 px-6">
        <div className="flex items-center justify-between">
          <div className="flex items-center">
            <Avatar className="mr-4">
              <AvatarImage alt="사용자 프로필 사진" src="/placeholder-user.jpg" />
              <AvatarFallback>JD</AvatarFallback>
            </Avatar>
            <div>
              <h1 className="text-xl font-bold">김범서</h1>
              <p className="text-gray-400">beomseo1210@gmail.com</p>
            </div>
          </div>
          <div className="flex items-center space-x-4">
            <Button className="font-medium text-black" size="sm" variant="outline">
              회원정보 수정
            </Button>
            <Button className="font-medium text-black" size="sm" variant="outline">
              로그아웃
            </Button>
          </div>
        </div>
      </header>
      <main className="flex-1 overflow-y-auto grid grid-cols-1 gap-6 p-6">
        <section className="bg-gray-100 dark:bg-gray-800 py-8 px-6">
          <div className="flex items-center justify-between mb-4">
            <h2 className="text-2xl font-bold">내 채널</h2>
            <div className="flex items-center space-x-4">
              <Input className="flex-1" placeholder="API 키를 입력하세요" type="text" />
              <Button size="sm" variant="outline">
                Refresh
              </Button>
            </div>
          </div>
          <div className="grid md:grid-cols-2 gap-6">
            <Card>
              <CardHeader>
                <CardTitle>채널 개요</CardTitle>
              </CardHeader>
              <CardContent>
                <div className="flex items-center mb-4">
                  <Avatar className="mr-4">
                    <AvatarImage alt="채널 프로필 사진" src="/placeholder-user.jpg" />
                    <AvatarFallback>YT</AvatarFallback>
                  </Avatar>
                  <div>
                    <h3 className="text-lg font-semibold">김범서의 유튜브 채널</h3>
                    <p className="text-gray-500 dark:text-gray-400 text-sm">www.youtube.com/@user-hy4pe1rc4</p>
                  </div>
                </div>
                <br />
                <br />
                <div className="grid grid-cols-3 gap-4 text-center">
                  <div>
                    <p className="text-2xl font-bold">4</p>
                    <p className="text-gray-500 dark:text-gray-400 text-sm">구독자 수</p>
                  </div>
                  <div>
                    <p className="text-2xl font-bold">10</p>
                    <p className="text-gray-500 dark:text-gray-400 text-sm">조회수</p>
                  </div>
                  <div>
                    <p className="text-2xl font-bold">1</p>
                    <p className="text-gray-500 dark:text-gray-400 text-sm">동영상 수</p>
                  </div>
                </div>
              </CardContent>
            </Card>
            <Card>
              <CardHeader>
                <CardTitle>채널 분석</CardTitle>
              </CardHeader>
              <CardContent>
                <div className="grid grid-cols-2 gap-4">
                  <div>
                    <p className="text-2xl font-bold">0%</p>
                    <p className="text-gray-500 dark:text-gray-400 text-sm">구독자 증가율</p>
                  </div>
                  <div>
                    <p className="text-2xl font-bold">0%</p>
                    <p className="text-gray-500 dark:text-gray-400 text-sm">조회수 증가율</p>
                  </div>
                  <div className="col-span-2 grid grid-cols-2 gap-4">
                    <LineChart className="w-full aspect-[4/3]" />
                    <BarChart className="w-full aspect-[4/3]" />
                  </div>
                </div>
              </CardContent>
            </Card>
          </div>
        </section>
        <section className="bg-gray-100 dark:bg-gray-800 py-8 px-6">
          <h2 className="text-2xl font-bold mb-4">YouTube Coach</h2>
          <div className="grid md:grid-cols-2 gap-6">
            <Card>
              <CardHeader>
                <CardTitle>업로드 동영상 정보</CardTitle>
              </CardHeader>
              <CardContent>
                <div className="grid grid-cols-1 gap-4">
                  <div className="space-y-2">
                    <Label htmlFor="title">제목</Label>
                    <Input id="title" placeholder="동영상 제목을 입력하세요" type="text" />
                  </div>
                  <div className="space-y-2">
                    <Label htmlFor="tags">태그</Label>
                    <Input id="tags" placeholder="동영상 태그를 입력하세요" type="text" />
                  </div>
                  <div className="flex items-end">
                    <Button size="sm">알림설정</Button>
                  </div>
                </div>
              </CardContent>
            </Card>
            <Card>
              <CardHeader>
                <CardTitle>AI 챗봇</CardTitle>
              </CardHeader>
              <CardContent>
                <div className="flex flex-col h-[400px]">
                  <div className="flex-1 overflow-y-auto p-4">
                    <div className="flex items-start gap-4 mb-4">
                      <Avatar className="shrink-0">
                        <AvatarImage alt="채팅봇 프로필 사진" src="/placeholder-user.jpg" />
                        <AvatarFallback>AI</AvatarFallback>
                      </Avatar>
                      <div className="bg-gray-200 dark:bg-gray-700 rounded-lg p-3 max-w-[80%]">
                        <p>안녕하세요! YouTube Coach 챗봇 서비스입니다. 어떤 도움이 필요 하신가요?</p>
                      </div>
                    </div>
                    <div className="flex items-start gap-4 mb-4 justify-end">
                      <div className="bg-blue-500 text-white rounded-lg p-3 max-w-[80%]">
                        <p>언제 동영상을 업로드할까?</p>
                      </div>
                      <Avatar className="shrink-0">
                        <AvatarImage alt="사용자 프로필 사진" src="/placeholder-user.jpg" />
                        <AvatarFallback>JD</AvatarFallback>
                      </Avatar>
                    </div>
                    <div className="flex items-start gap-4 mb-4">
                      <Avatar className="shrink-0">
                        <AvatarImage alt="채팅봇 프로필 사진" src="/placeholder-user.jpg" />
                        <AvatarFallback>AI</AvatarFallback>
                      </Avatar>
                      <div className="bg-gray-200 dark:bg-gray-700 rounded-lg p-3 max-w-[80%]">
                        <p>네, 제가 동영상 업로드 시기에 대해서 자세히 설명해드리겠습니다.</p>
                      </div>
                    </div>
                  </div>
                  <div className="border-t dark:border-gray-700 p-4">
                    <Input className="w-full" placeholder="메시지를 입력하세요..." type="text" />
                  </div>
                </div>
              </CardContent>
            </Card>
          </div>
        </section>
      </main>
    </div>
  );
}

function BarChart(props) {
  return (
    <div {...props}>
      <ResponsiveBar
        data={[
          { name: "Jan", count: 111 },
          { name: "Feb", count: 157 },
          { name: "Mar", count: 129 },
          { name: "Apr", count: 150 },
          { name: "May", count: 119 },
          { name: "Jun", count: 72 },
        ]}
        keys={["count"]}
        indexBy="name"
        margin={{ top: 0, right: 0, bottom: 40, left: 40 }}
        padding={0.3}
        colors={["#2563eb"]}
        axisBottom={{
          tickSize: 0,
          tickPadding: 16,
        }}
        axisLeft={{
          tickSize: 0,
          tickValues: 4,
          tickPadding: 16,
        }}
        gridYValues={4}
        theme={{
          tooltip: {
            chip: {
              borderRadius: "9999px",
            },
            container: {
              fontSize: "12px",
              textTransform: "capitalize",
              borderRadius: "6px",
            },
          },
          grid: {
            line: {
              stroke: "#f3f4f6",
            },
          },
        }}
        tooltipLabel={({ id }) => `${id}`}
        enableLabel={false}
        role="application"
        ariaLabel="A bar chart showing data"
      />
    </div>
  );
}

function LineChart(props) {
  return (
    <div {...props}>
      <ResponsiveLine
        data={[
          {
            id: "Desktop",
            data: [
              { x: "Jan", y: 43 },
              { x: "Feb", y: 137 },
              { x: "Mar", y: 61 },
              { x: "Apr", y: 145 },
              { x: "May", y: 26 },
              { x: "Jun", y: 154 },
            ],
          },
          {
            id: "Mobile",
            data: [
              { x: "Jan", y: 60 },
              { x: "Feb", y: 48 },
              { x: "Mar", y: 177 },
              { x: "Apr", y: 78 },
              { x: "May", y: 96 },
              { x: "Jun", y: 204 },
            ],
          },
        ]}
        margin={{ top: 10, right: 10, bottom: 40, left: 40 }}
        xScale={{
          type: "point",
        }}
        yScale={{
          type: "linear",
        }}
        axisTop={null}
        axisRight={null}
        axisBottom={{
          tickSize: 0,
          tickPadding: 16,
        }}
        axisLeft={{
          tickSize: 0,
          tickValues: 5,
          tickPadding: 16,
        }}
        colors={["#2563eb", "#e11d48"]}
        pointSize={6}
        useMesh={true}
        gridYValues={6}
        theme={{
          tooltip: {
            chip: {
              borderRadius: "9999px",
            },
            container: {
              fontSize: "12px",
              textTransform: "capitalize",
              borderRadius: "6px",
            },
          },
          grid: {
            line: {
              stroke: "#f3f4f6",
            },
          },
        }}
        role="application"
      />
    </div>
  );
}
